import React from 'react';
import LogoImage from '../assets/Logo Escrito 2 Azul PNG.png'; // Importe a imagem aqui
import '../styles/Header.css'; // Importe o arquivo CSS diretamente

function Header() {
    return (
        <header className="header"> {/* Use uma classe específica para o cabeçalho */}
            <nav className="menu-principal">
                <div className="menu-links">
                    <img src={LogoImage} alt="Logo" className="logteste" />
                </div>
            </nav>
        </header>
    );
}

export default Header;
